import { useEffect } from 'react';
import AuthUser from './AuthUser';

export default function Dashboard() {
    const { fetchUsers, users } = AuthUser();
    const { fetchPosts, posts } = AuthUser();

    useEffect(() => {
      fetchUsers();
      fetchPosts();
    }, []);

    return (
      <table className="table">
        <thead>
          <tr>
            <th>ID</th>
            <th>Name</th>
            <th>Email</th>
            <th>Actions</th>
          </tr>
        </thead>
        <tbody>
          {users.map((user) => (
            <tr key={user.id}>
              <td>{user.id}</td>
              <td>{user.name}</td>
              <td>{user.email}</td>
              <td>
                <button className="btn btn-danger">
                  Usu≈Ñ
                </button>
                <button className="btn btn-primary">
                  Edytuj
                </button>
              </td>
            </tr>
          ))}
        </tbody>
      </table>
    );
}
